import React from 'react';
import Stack from '@mui/material/Stack';
import Button from '@mui/material/Button';

function TestPage() {
  return (
    <div>
      <Stack spacing={5} sx={{ p: 2, width: { xs: '100%', md: '100%', lg: '80%' }, margin: 'auto', textAlign: 'center' }}>
        
        {/* First Stack for Profile and Name */}
        <Stack direction="row" spacing={2} sx={{ mb: 2, alignItems: 'center' }}>
          {/* Profile Image */}
          <div style={{ width: 50, height: 50, borderRadius: '50%', overflow: 'hidden', backgroundColor: 'black' }}>
            <img 
              src="https://vehiclemaintenance.blob.core.windows.net/profilepics/blue-car.png" 
              alt="Profile" 
              style={{ width: '100%', height: '100%', objectFit: 'cover' }} 
            />
          </div>

          {/* Name */}
          <div style={{ textAlign: 'left', backgroundColor: 'green' }}>
            <strong>John Doe</strong>
          </div>
        </Stack>

        {/* Second Stack for Buttons */}
        <Stack direction="row" spacing={2}>
          <Button variant="text">Button 3</Button>
          <Button variant="contained">Button 4</Button>
        </Stack>
      </Stack>
    </div>
  );
}

export default TestPage;
